    async fetchCourses(email) {
      try {
        const response = await axios.get('ServletProfessorRequests', {
          params: {
            action: 'getCourses',
            professorEmail: email
          }
        });
        console.log(response.data);
      } catch (e) {
        console.log(e.response);
      }
    }
  }
};
